import React from 'react';
import '../Community/Community.css';
// import Tech from '../../assert/languages.png';



const Community = () => {
  return (
    <div className='Community-container'>
        <h1 className='community-h1'>What we can do for you</h1>
       <div className='Community-details'>
          <div className='Technology-img'>
            {/* <img src={Tech} alt='' /> */}
          </div> 
          <p className='community-p'>
          1. Application Development: Our primary responsibility will be to design, develop, and maintain applications that facilitate better communication and engagement with your customers. These applications could be mobile apps, web applications, or even chatbots, depending on the specific needs of your business.
          <p>
          2. Customer Experience Enhancement: The applications we'll develop should aim to enhance the overall customer experience. This might include features like personalized recommendations, smooth user interfaces, and efficient customer support functionalities.
          </p>
          <p>
           3. Data Analysis and Insights: As a Virtual Assistant, we'll be expected to analyze data generated by these applications. By understanding user behavior and preferences, we can provide valuable insights to improve the applications further.
          </p>
          <p>
           4. Technical Support: We will be the go-to person for any technical issues related to the applications. This involves troubleshooting, bug fixing, and continuous monitoring to ensure the applications are running smoothly.
          </p>
          <p>

          </p>
          </p>  
       </div>
    </div>
  )
}

export default Community
